import axios from "axios";
import { baseic } from "./ApiClient";

export const basicAuthentication = (token)=> baseic.get('basicauth',{
    headers:{
        Authorization:token
    }
})

export const basicJWTAuthentication
= (username,password)=>
 baseic.post('authenticate',{username,password})

export const authenticaon=(username,password)=>axios.post('http://localhost:8080/authenticate',{username,password})
